Well folks, the 2018/19 winter has been a great one for Southern California, but finally coming to an end

@snow_summit will be slinging chairs through Saturday, and @mtbaldyresort and @snowvalleymtnresort will be closing out the local season on Sunday.

It will soon be time to start packing up the car and heading North for some turns, but in the meantime, enjoy the snow here while we still have it!  #socal #ski #snowboarding #angelesnationalforest #sanbernadinonationalforest #springcorn #mtbaldy #mtbaldyskilifts #bigbearlake #snowsummit #snowvalley #southcalsnow #losangeles

