शिवाजी महाराज in Chennai
छत्रपती शिवाजी महाराज कर्नाटक स्वारीवर असताना त्यांनी ३ आक्टोंबर १६७७ साली चेन्नईमधील काली कम्बल मंदिरात जाऊन देवीची पूजा करून बांधकामाची मुहूर्तमेढ रोवली. अगदी दोन दिवस महाराजांनी तेथे थांबून देवीच्या सानिध्याचा अस्वाध घेतला. पुढे महाराजापासून प्रेरणा घेऊन तामिळीनी स्वातंत्र्याचा लढा उभा केला. राजांची आठवण म्हणून अगदी मंदिराच्या प्रवेशद्वारावर तिथल्या लोकांनी त्यांचा फोटो लाऊन एका दगडावर शिवाजीमहाराज आल्याची नोंद करून ठेवली आहे. चेन्नईमध्ये अनेक मराठा लोक असून त्यांनी 'मद्रास मराठा संघम' नावाची संघटना स्थापन करून त्यांच्याकडून १९ फेब्रुवारीला फार मोठ्या प्रमाणावर शिवजयंती साजरी केली जाते. जगाच्या पाठीवर कुठही गेलेतरी राजे हे राजेच होते याची जाणीव झाल्याशिवाय राहत नाही. चेन्नईत नरसिंगराव कदम हे याकामी पुढाकार घेऊन काम करत आहेत.

